import Navbar from "./components/Navbar";
import {
  BrowserRouter as Router,
  Switch,
  Route,
} from "react-router-dom";
import './App.css';
import Home from "./pages";
import Contact from "./pages/Contact";
import Epk from "./pages/Epk";

function App() {
  return (
    <Router>
      <div>
        <Switch>
          <Route exact path = "/" component = {Home}></Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
